import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;


import React from "react";
import { ArrowBack } from "./ArrowBack";
import "./style.css";

export const Frame = () => {
  return (
    <div className="frame">
      <div className="overlap-group-wrapper">
        <div className="overlap-group">
          <div className="arrow-back-wrapper">
            <ArrowBack className="arrow-back" />
          </div>
          <button className="button">
            <button className="text-wrapper">Dasboard OverView</button>
          </button>
          <button className="button-wrapper">
            <button className="div">Geospatial Map</button>
          </button>
          <button className="div-wrapper">
            <button className="div">Charts &amp; Graphs</button>
          </button>
          <button className="button-2">
            <button className="div">ISP Leaderboard</button>
          </button>
          <button className="button-3">
            <button className="div">History Analysis</button>
          </button>
        </div>
      </div>
    </div>
  );
};
